import React, { useEffect, useState } from 'react';
import { fetchInfluenceByAuthor, fetchInfluenceByPaper } from '../services/api';

function InfluencePage() {
  const [viewMode, setViewMode] = useState('author'); // 'author' or 'paper'
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const res = viewMode === 'author'
        ? await fetchInfluenceByAuthor()
        : await fetchInfluenceByPaper();
      setData(res.data.slice(0, 15)); // 상위 15개만
    };
    fetchData();
  }, [viewMode]);

  return (
    <div style={{ padding: '20px' }}>
      <h2>Influence Ranking</h2>

      {/* 버튼: 보기 전환 */}
      <div style={{ marginBottom: '15px' }}>
        <button
          onClick={() => setViewMode('author')}
          style={{ marginRight: '10px', fontWeight: viewMode === 'author' ? 'bold' : 'normal' }}
        >
          Author-based
        </button>
        <button
          onClick={() => setViewMode('paper')}
          style={{ fontWeight: viewMode === 'paper' ? 'bold' : 'normal' }}
        >
          Citation-based
        </button>
      </div>

      <table border="1" cellPadding="5" cellSpacing="0">
        <thead>
          <tr>
            {viewMode === 'author' ? (
              <>
                <th>Community</th>
                <th>Author</th>
                <th>Intra PR</th>
                <th>Community PR</th>
                <th>Total Influence</th>
                <th>Top Paper</th>
              </>
            ) : (
              <>
                <th>Paper</th>
                <th>Year</th>
                <th>Citation Count</th>
                <th>PageRank</th>
              </>
            )}
          </tr>
        </thead>
        <tbody>
          {viewMode === 'author' ? (
            data.map((row, idx) => (
              <tr key={idx}>
                <td>{row.community_id}</td>
                <td>{row.author}</td>
                <td>{(row.intra_pagerank ?? 0).toFixed(5)}</td>
                <td>{(row.community_pagerank ?? 0).toFixed(5)}</td>
                <td>{(row.total_influence ?? 0).toFixed(5)}</td>
                <td>
                  {row.top_paper
                    ? `${row.top_paper.title} (${row.top_paper.citationCount ?? 0} citations)`
                    : 'N/A'}
                </td>
              </tr>
            ))
          ) : (
            data.map((row, idx) => (
              <tr key={idx}>
                <td>{row.title}</td>
                <td>{row.year}</td>
                <td>{row.citationCount}</td>
                <td>{(row.pagerank ?? 0).toFixed(5)}</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
}

export default InfluencePage;
